import React, { useState } from "react";

function Darbai({
  klase = "d-flex align-items-center justify-content-between",
  stilius = {},
  darbas = "darbas.png",
  logo_plotis = 100,
}) {
    return (
      <>
        <p>Mano darbai </p>
            <img
                    src={require("./images/" + darbas)}
                    alt="Darbas"
                  />
      </>
    );
  }

export default Darbai;
